import React, { Component } from "react";

class Header extends Component {
  render() {
    const { user } = this.props;
    return (
      <div>
        {!user && (
          <Link className="navbar-brand navbar-primary" to="/LogIn">
            <button className="btn btn-primary">Log In</button>
          </Link>
        )}
        {user && (
          <Link className="navbar-brand navbar-primary" to="/">
            <button className="btn btn-primary">Log Out</button>
          </Link>
        )}

        <div className="container p-2 d-flex justify-content-center">
          <div className="card h-50 m-2" style={{ width: "7rem" }}>
            <img
              src={require("../IMG-5355.jpg")}
              alt="Card Image top"
              className="card-img-top"
            />
          </div>
        </div>
      </div>
    );
  }
}

export default Header;
